    `modified_date`  datetime     NOT NULL DEFAULT now(),
    `marketing_name` varchar(200) ,
    `model`          varchar(200) NOT NULL UNIQUE,
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = latin1;

